import React, { useState } from 'react';
import './sign-up.style.scss';

import { FormInput } from '../form-input/form-input.component';
import { StyleButton } from '../styled-button/styled-button.component';
import { auth, createUser } from '../../firebase/filrebase.util';

export const SignUp = () => {
  const [userInfo, setUserInfo] = useState({
    displayName: '',
    email: '',
    password: '',
  });
  console.log('hahia', userInfo);

  return (
    <div className="sign-up">
      <div className="title">
        <h1> Sign up if you Do not have Account Yet</h1>
      </div>
      <form onSubmit={() => { setUserInfo({}); }}>
        <FormInput
          name="email"
          type="email"
          label="EMAIL"
          value={userInfo.email}
          handleChange={(event) => setUserInfo({ email: event.target.value })}
          required
        />
        <FormInput
          name="password"
          type="password"
          label="PASSWORD"
          value={userInfo.password}
          handleChange={(event) => setUserInfo({ password: event.target.value })}
          required
        />
        <div className="buttons">
          <StyleButton type="submit"> Sign In </StyleButton>
        </div>
      </form>
    </div>
  );
};
export default SignUp;
